import React from 'react';
import logo from './logo.svg';
import DetailsForm from './DetailsForm';
import './App.css';

function App() {

  const state = {
    clientId: '',
    clientSecret: '',
    authEndpoint: '',
    tokenEndpoint: ''
  }

  return (
    <div className="App">
      <header className="App-header">


        <p>Client ID: {state.clientId}</p>


        <DetailsForm changeHandler={state}/>

      </header>
    </div>
  );
}

export default App;
